import React from "react";
import { Switch, Route } from "react-router-dom";
import Navbar from "./Navbar";
import Page from "./Page";
import Contect from "./Contect";
import Footer from "./Footer";
// import Team from "./Team";
import Errorpage from "./ErrorPage";
import SvgHome from "./SvgHome";
import SvgAbout from "./SvgAbout";

function MainApp() {
  return (
    <div className="mainApp">
      <Navbar />
      <Switch>
        {/* HOME PAGE */}
        <Route
          exact
          path="/"
          component={() => {
            return (
              <Page
                pageName="Home"
                moto="Grow Your Business With Us"
                companyName="Developers Hub"
                about="We are a team of Talent And Experianced Software Developers"
                buttenInnerText="Get Stareted"
                SvgHome={() => {
                  return <SvgHome />;
                }}
              />
            );
          }}
        />
        {/* ABOUT PAGE */}
        <Route
          exact
          path="/about"
          component={() => {
            return (
              <Page
                pageName="About"
                moto=" Have You Had Your Softwares Today? "
                companyName="Developers Hub"
                about="We have been developing softwares for more then 20 years"
                buttenInnerText="Contect Us"
                SvgHome={() => {
                  return <SvgAbout />;
                }}
              />
            );
          }}
        />
        {/* CONTECT US */}
        <Route
          exact
          path="/contect"
          component={() => {
            return <Contect />;
          }}
        />
        {/*PROJECTS */}
        <Route
          exact
          path="/projects"
          component={() => {
            return <h1>Construction is progress...</h1>;
          }}
        />
        {/*OUR TEAM */}
        <Route
          exact
          path="/team"
          // component={() => {
          //   return <Team />;
          // }}
        />
        {/*ERROR PAGE */}
        <Route
          component={() => {
            return <Errorpage />;
          }}
        />
      </Switch>
      <Footer />
    </div>
  );
}

export default MainApp;
